import React, { FC, ReactNode } from 'react';
import Header from './Header';

type propTypes = {
  children?: ReactNode;
};

const Layout: FC = ({ children }: propTypes) => (
  <>
    <p>Header</p>
    <Header />
    {children}
    <p>footer</p>
  </>
);

export default Layout;
